import "./App.css";
import { useState } from "react";
import { validateEmail } from "./utils";

const PasswordErrorMessage = () => {
  return (

    <p className="FieldError">Password should have at least 8 characters</p>
  );
};

function App() {
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState({
    value: "",
    isTouched: false,
  });
  const [role, setRole] = useState("");

  const getIsFormValid = () => {
    // Implement this function

      // Check if the first name is not empty
      const isFirstNameValid = firstName !== "";

      // Check if the email is valid using the provided validateEmail function
      const isEmailValid = validateEmail(email);

      // Check if the password is at least 8 characters long
      const isPasswordValid = password.value.length >= 8;

      // Check if the role is either 'individual' or 'business'
      const isRoleValid = role === 'individual' || role === 'business';

      // Return true if all validations pass, otherwise return false
      return isFirstNameValid && isEmailValid && isPasswordValid && isRoleValid;


    };



  const clearForm = () => {
    // Implement this function
    setFirstName("");
    setLastName("");
    setEmail("");
    setPassword({ value: "", isTouched: false });
    setRole("role");
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    alert("Account created!");
    clearForm();
  };


  return (
    <div className="App">
      <form onSubmit={handleSubmit}>
        <fieldset>
          <h2>Sign Up</h2>
          <div className="Field">
            <label>
              First name <sup>*</sup>
            </label>
            <input 
            placeholder="First name" 
            type="text"
            onChange={(e)=>setFirstName(e.target.value)}
            />
          </div>
          <div className="Field">
            <label>Last name</label>
            <input 
            placeholder="Last name" 
            type="text"
            onChange={(e)=>setLastName(e.target.value)}
            />
          </div>
          <div className="Field">
            <label>
              Email address <sup>*</sup>
            </label>
            <input 
            placeholder="Email address" 
            type="email"
            onChange={(e)=>setEmail(e.target.value)}
            />
          </div>
          <div className="Field">
            <label>
              Password <sup>*</sup>
            </label>
            <input
             placeholder="Password" 
             type="password"
             onChange={(e)=>setPassword({value: e.target.value, isTouched:true})}
             />
             {password.isTouched && password.value.length < 8 && <PasswordErrorMessage/>}
          </div>
          <div className="Field">
            <label>
              Role <sup>*</sup>
            </label>
            <select onChange={(e) => setRole(e.target.value)}>
              <option value="role">Role</option>
              <option value="individual">Individual</option>
              <option value="business">Business</option>
            </select>
          </div>
          <button type="submit" disabled={!getIsFormValid()}>
            Create account
          </button>
        </fieldset>
      </form>
    </div>
  );
}

export default App;
